import React from 'react';
import {BrowserRouter as Router,Route,Link} from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import './App.css'; 
import Sidebar from './components/Sidebar';
import Footer from './components/Footer'; 
import HomeSection from './pages/HomeSection' ;
import AboutSection from './pages/AboutSection' ;
import EducationSection from './pages/EducationSection.js' ;

const items = [
  { name: 'home', label: 'Home' },
  { name: 'sales', label: 'Sales' },
  { name: 'orders', label: 'Orders' },
  { name: 'billing', label: 'Billing' },
  { name: 'settings', label: 'Settings' }]

class App extends React.Component {


	constructor(props) {
		super(props);
		this.state = {
			title: 'Thana Shree',
			headerLinks:[
			{ title : 'Home ' , path: '/'},
			{ title : 'About' , path: '/about'},
			{ title : 'Education' , path: '/education'},
			{ title : 'Experience' , path: '/experience'},
			{ title : 'Projects' , path: '/projects'}
			],
			home: {
				title: ' Be Relentless',
				subTitle : 'Projects that make a difference',
				text: 'checkout my projs'
			},
			about : {
				title: 'About me',
			},
			education :  {
				title: ' Lets talk',
			}  
		}
	}
  render() {
	  return(
	  <React.Fragment>
		  <Router>
		  <Sidebar items={items}/>
		  <Route path="/" exact render={() => <HomeSection title={this.state.home.title} subTitle={this.state.home.subTitle} text = {this.state.home.text} /> } />
		<Route path="/about"  render={() => <AboutSection title={this.state.about.title} /> } />
		<Route path="/education"  render={() => <EducationSection title={this.state.education.title}  /> } />
		<Footer/>


		  </Router>
		  </React.Fragment>

  );
  }
}

export default App;
